webpackJsonp([0xe52cdc9e86b5],{534:function(t,e){t.exports={data:{wordpressPost:{title:"Bicycling injury hospitalisation rates, clinical trial registration and women in leadership roles: Most read articles in November",content:'<h1>Bicycling injuries, clinical trial registration, and the under-representation of women in leadership roles</h1>\n<p><img class="alignnone" title="Image: Left side of Flying Pigeon.jpg, from Wikipedia, by 齐健" src="https://upload.wikimedia.org/wikipedia/commons/thumb/4/41/Left_side_of_Flying_Pigeon.jpg/800px-Left_side_of_Flying_Pigeon.jpg" alt="" width="306" height="204" /></p>\n<p>This month sees a lot of change in the Top 10 Most Read, with many new papers entering the list. At number one this month is Teschke<em> et al</em>&#8216;s assessment of bicycling injury hospitalisation rates with relation to helmet legislation and mode shares, which has generated a lot of interest both on our site and on Twitter. Our second most read article takes a look at clinical trial registration, reporting and publication rates for new drugs approved by the US Food and Drug Administration. Bismark <em>et al</em> examine the reasons for the under-representation of women in medical leadership roles via a qualitative study at number six, and maintaining its position at number five this month is Hysing <em>et al</em>&#8216;s paper on adolescent use of electronic devices in relation to sleep.</p>\n<table border="1" width="483" cellspacing="0" cellpadding="0">\n<tbody>\n<tr>\n<td valign="top" width="50">Rank</td>\n<td valign="top" width="132">Author(s)</td>\n<td valign="top" width="301">Title</td>\n</tr>\n<tr>\n<td width="50">1</td>\n<td width="132">Teschke <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/5/11/e008052.full">Bicycling injury hospitalisation rates in Canadian jurisdictions: analyses examining associations with helmet legislation and mode share</a></td>\n</tr>\n<tr>\n<td width="50">2</td>\n<td width="132">Miller <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/5/11/e009758.full">Clinical trial registration, reporting, publication and FDAAA compliance: a cross-sectional analysis and ranking of new drugs approved by the FDA in 2012</a></td>\n</tr>\n<tr>\n<td width="50">3</td>\n<td width="132">Kristensen <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/5/9/e007118.full">The effect of statins on average survival in randomised trials, an analysis of end point postponement</a></td>\n</tr>\n<tr>\n<td width="50">4</td>\n<td width="132">Tricco <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/5/10/e009183.full">Comparative safety and effectiveness of long-acting inhaled agents for treating chronic obstructive pulmonary disease: a systematic review and network meta-analysis</a></td>\n</tr>\n<tr>\n<td width="50">5</td>\n<td width="132">Hysing <em>et al.</em></td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/5/1/e006748.full">Sleep and use of electronic devices in adolescence: results from a large population-based study</a></td>\n</tr>\n<tr>\n<td width="50">6</td>\n<td width="132">Bismark <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/5/11/e009384.full">Reasons and remedies for under-representation of women in medical leadership roles: a qualitative study from Australia</a></td>\n</tr>\n<tr>\n<td width="50">7</td>\n<td width="132">Bove <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/5/7/e008031.full">Efficacy of a minimal home-based psychoeducative intervention versus usual care for managing anxiety and dyspnoea in patients with severe chronic obstructive pulmonary disease: a randomised controlled trial protocol</a></td>\n</tr>\n<tr>\n<td width="50">8</td>\n<td width="132">Deane <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/12/e006434.full">Priority setting partnership to identify the top 10 research priorities for the management of Parkinson&#8217;s disease</a></td>\n</tr>\n<tr>\n<td width="50">9</td>\n<td width="132">Chaibi <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/5/11/e008095.full">Chiropractic spinal manipulative therapy for migraine: a study protocol of a single-blinded placebo-controlled randomised clinical trial</a></td>\n</tr>\n<tr>\n<td width="50">10</td>\n<td width="132">Hubble <em>et al</em>.</td>\n<td valign="top" width="301"><a href="http://bmjopen.bmj.com/content/4/12/e006095.full">Trunk muscle exercises as a means of improving postural stability in people with Parkinson&#8217;s disease: a protocol for a randomised controlled trial</a></td>\n</tr>\n</tbody>\n</table>\n<p><em>Most read figures are based on pdf downloads and full text views. Abstract views are excluded.</em><!--TrendMD v2.4.3--></p>\n'},site:{siteMetadata:{title:"Gatsby Default Starter"}}},pathContext:{id:"8cfa3f26-b5f5-5159-b750-cc0eab29c015"}}}});
